import React, {Component} from 'react'


class FooterComponent extends Component {
    render() {
        return (
            <footer className="footer">
                <span className="text-muted">Alrights Reserved 2020 @Basil.com</span>
            </footer>
        )
    }
}

export default FooterComponent
